jQuery(function ($) {

    /*----------------------/
     /* PAGE LOADER
     /*---------------------*/

    $('body').jpreLoader({
        showSplash: false,
        loaderVPos: "50%"
    });


    /*----------------------/
     /* MAIN NAVIGATION
     /*---------------------*/

    $(window).on('scroll', function () {
        if ($(window).width() > 1024) {
            if ($(document).scrollTop() > 150) {
                setNavbarLight();
            } else {
                setNavbarTransparent();
            }
        }
    });

    function toggleNavbar() {
        if (($(window).width() > 1024) && ($(document).scrollTop() <= 150)) {
            setNavbarTransparent();
        } else {
            setNavbarLight();
        }
    }

    toggleNavbar();

    $(window).resize(function () {
        toggleNavbar();
    });

    /* navbar setting functions */
    function setNavbarLight() {
        $('.navbar').addClass('navbar-light');
        $('.navbar-brand h1').css('color', '#646464');
    }

    function setNavbarTransparent() {
        $('.navbar').removeClass('navbar-light');
        $('.navbar-brand h1').css('color', '#fff');
    }

    // hide collapsible menu
    $('.navbar-nav li a').click(function () {
        if ($(this).parents('.navbar-collapse.collapse').hasClass('in')) {
            $('#main-nav').collapse('hide');
        }
    });

    $('#main-nav').localScroll({
        duration: 1000,
        easing: 'easeInOutExpo'
    });

    $('.hero-buttons').localScroll({
        duration: 1000,
        easing: 'easeInOutExpo'
    });


    /*----------------------/
     /* HERO UNIT SUPERSIZED
     /*---------------------*/

    if ($('.slideshow').length > 0) {
        $.supersized({

            // Functionality
            autoplay: 1,				// Slideshow starts playing automatically
            slide_interval: 5000,		// Length between transitions
            transition: 1, 				// 0-None, 1-Fade, 2-Slide Top, 3-Slide Right, 4-Slide Bottom, 5-Slide Left, 6-Carousel Right, 7-Carousel Left
            transition_speed: 1000,		// Speed of transition

            // Components
            slide_links: 'blank',		// Individual links for each slide (Options: false, 'num', 'name', 'blank')
            thumb_links: 0,				// Individual thumb links for each slide
            slides: [				// Slideshow Images
                {image: 'assets/img/sliders/slider1.jpg', title: '<div class="hero-text"><h2 class="hero-heading">VINNIE MAGRO</h2><p>Hacker</p></div>', thumb: '', url: ''},
                {image: 'assets/img/sliders/slider2.jpg', title: '<div class="hero-text"><h2 class="hero-heading">VINNIE MAGRO</h2><p>Computer Engineer</p></div>', thumb: '', url: ''},
                {image: 'assets/img/sliders/slider3.jpg', title: '<div class="hero-text"><h2 class="hero-heading">VINNIE MAGRO</h2><p>Tech Enthusiast</p></div>', thumb: '', url: ''}
            ],
        });

        $(".fa-pause, .fa-play").click(function () {
            $(this).toggleClass("fa-pause fa-play");
        });
    }


    /*-----------------------------/
     /* HERO UNIT FULLSCREEN VIDEO
     /*---------------------------*/

    if ($('.hero-video').length > 0) {
        var videoOptions = {
            mp4: 'assets/videos/motion.mp4',
            webm: 'assets/videos/caramel.webm',
            ogv: 'assets/videos/motion.ogv',
            opacity: 1,
            zIndex: 0,
            muted: 'muted'
        }

        // iPhone seems provide video accesibility, so don't give poster to show the video
        if ($(window).width() > 480) {
            videoOptions.poster = 'assets/img/sliders/slider3.jpg';
        }

        $('.hero-video').videoBG(videoOptions);

        // resize the wrapper as the video resized
        $(window).resize(function () {
            $('.videoBG_wrapper').width('100%').height('100%');
            $('.videoBG').width('100%');
        });

        // video volume control
        $('.fa-volume-up, .fa-volume-off').click(function () {
                $('.videoBG video').toggleVolume();
                $(this).toggleClass("fa-volume-up fa-volume-off");
            }
        );

        $.fn.toggleVolume = function () {
            var domVideo = $(this).get(0);

            if (domVideo.muted == true) {
                domVideo.muted = false;
            } else {
                domVideo.muted = true;
            }
        }
    }


    /*----------------------/
     /* PARALLAX
     /*---------------------*/

    $('.full-width-parallax').parallax(0, 0.1);

    function setParallax() {
        if ($(window).width() > 1024) {
            $('.full-width-parallax').parallax(0, 0.1);
        }
    }

    setParallax();

    $(window).resize(function () {
        setParallax();
    });

    /*----------------------/
     /* SKILLS
     /*---------------------*/

    $('#skills').waypoint(function () {
            $('.chart').each(function () {
                $(this).easyPieChart({
                    size: 150,
                    barColor: '#ffae3f',
                    trackColor: '#eee',
                    scaleColor: false,
                    lineWidth: 2,
                    easing: 'easeOutExpo',
                    animate: 2000
                });
            });
        },
        {
            offset: '70%'
        });


    /*----------------------/
     /* SCROLL TO TOP
     /*---------------------*/

    if ($(window).width() > 992) {
        $(window).scroll(function () {
            if ($(this).scrollTop() > 300) {
                $('.back-to-top').fadeIn();
            } else {
                $('.back-to-top').fadeOut();
            }
        });

        $('.back-to-top').click(function (e) {
            e.preventDefault();

            $('body, html').animate({
                scrollTop: 0
            }, 800, 'easeInOutExpo');
        });
    }


    /*----------------------/
     /* WORKS
     /*---------------------*/

    var $container = $('.work-item-list');

    new imagesLoaded($container, function () {
        $container.isotope({
            itemSelector: '.work-item'
        });
    });

    $(window).smartresize(function () {
        $container.isotope('reLayout');
    });

    $('.work-item-filters a').click(function (e) {

        var selector = $(this).attr('data-filter');
        $container.isotope({
            filter: selector
        });

        $('.work-item-filters a').removeClass('active');
        $(this).addClass('active');

        return false;
    });

    var originalTitle, currentItem;

    $('.media-popup').magnificPopup({
        type: 'image',
        callbacks: {
            beforeOpen: function () {

                // modify item title to include description
                currentItem = $(this.items)[this.index];
                originalTitle = currentItem.title;
                currentItem.title = '<h3>' + originalTitle + '</h3>' + '<p>' + $(currentItem).parents('.work-item').find('img').attr('alt') + '</p>';

                // adding animation
                this.st.mainClass = 'mfp-fade';
            },
            close: function () {
                currentItem.title = originalTitle;
            }
        }

    });


    /*----------------------/
     /* SOCIAL NETWORK
     /*---------------------*/

    if ($(window).width() > 1024) {
        wow = new WOW({
            animateClass: 'animated'
        });

        wow.init();
    } else {
        $('.wow').attr('class', '');
    }


    /*----------------------/
     /* TOOLTIP
     /*---------------------*/

    if ($(window).width() > 1024) {
        $('body').tooltip({
            selector: "[data-toggle=tooltip]",
            container: "body"
        });
    }


    /*----------------------/
     /* AJAX CONTACT FORM
     /*---------------------*/

    $('#contact-form').parsley();

    $('.contact-form form').submit(function (e) {

        e.preventDefault();

        if (!$(this).parsley('isValid'))
            return;

        $theForm = $(this);
        $btn = $(this).find('#submit-button');
        $btnText = $btn.text();
        $alert = $(this).parent().find('.alert');

        $btn.find('.loading-icon').addClass('fa-spinner fa-spin ');
        $btn.prop('disabled', true).find('span').text("Sending...");

        $.ajax({
            url: '//formspree.io/vm+w@vinnie.io',
            method: 'POST',
            data: $(this).serialize(),
            dataType: 'json',
            success: function formSuccess() {
                $theForm.slideUp('medium', function () {
                    $alert.removeClass('alert-danger');
                    $alert.addClass('alert-success').html("Message submitted").slideDown('medium');
                });

                $btn.find('.loading-icon').removeClass('fa-spinner fa-spin ');
                $btn.prop('disabled', false).find('span').text($btnText);
            },
            error: function formErr() {
                $alert.addClass('alert-danger').html("Failed to submit message").slideDown('medium');
            }
        });

    });


    // init scrollspy except on Opera, it doesn't work because body has 100% height
    if (!navigator.userAgent.match("Opera/")) {
        $('body').scrollspy({
            target: '#main-nav'
        });
    } else {
        $('#main-nav .nav li').removeClass('active');
    }

});
